	add("pomegranate", "{\"term\":\"pomegranate\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027pomme grenate\u0027 from \u0027pomum\u0027 (fruit) + \u0027granatum\u0027 (having many seeds)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fruit-bearing shrub or small tree, \u0027Punica granatum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Fahiem E. El-Borai, Larry W. Duncan, \u002712: Nematode Parasites of Subtropical and Tropical Fruit Tree Crops\u0027, M. Luc, Richard A. Sikora, J. Bridge (editors), \u0027Plant Parasitic Nematodes in Subtropical and Tropical Agriculture\u0027, 2nd Edition, [http://books.google.com.au/books?id\u003dGAdsEt6dEtwC\u0026amp;pg\u003dPA481\u0026amp;dq\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsK9iUczaDoSfiQf834DgBw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;f\u003dfalse page 481\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027pomegranate\u0027\u0027 (\u0027Punica granatum\u0027 L.) originates from Persia, and is cultivated in western and central Asia and in the Mediterranean region; it is also grown commercially in California.The predominant parasitic nematodes affecting \u0027\u0027pomegranate\u0027\u0027 are the root knot nematodes, \u0027M.\u0026lt;sup\u0026gt;[Meloidogyne]\u0026lt;/sup\u0026gt; incognita\u0027, \u0027M. acrita\u0027 and \u0027M. javanica\u0027 (McSorley, 1981\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Payam Nabarz, \u0027The Mysteries of Mithras: The Pagan Belief That Shaped the Christian World\u0027, [http://books.google.com.au/books?id\u003dOltMzIU1ae0C\u0026amp;pg\u003dPA79\u0026amp;dq\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsK9iUczaDoSfiQf834DgBw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;f\u003dfalse page 79\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027pomegranate\u0027\u0027 is the tree of knowledge in some myths. In others, it is linked with the underworld\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, M. N. V. Prasad, \u0027Trace Elements as Contaminants and Nutrients\u0027, [http://books.google.com.au/books?id\u003dFRJsxgZXxUMC\u0026amp;pg\u003dPA225\u0026amp;dq\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d3eZiUZuXAeeaiAf4o4C4Dw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;f\u003dfalse page 225\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In this experiment, the average Zn concentration of leaf in four \u0027\u0027pomegranate\u0027\u0027 cultivars was between 12.0 and 19.8mg/kg in the control (Fig. 2a\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The fruit of \u0027Punica granatum\u0027, about the size of an orange and having a red pulp containing many seeds and enclosed in a thick, hard, reddish skin\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Vern L. Bullough (editor), \u0027Herbal Contraceptives and Abortifacients\u0027, \u0027Encyclopedia of Birth Control\u0027, [http://books.google.com.au/books?id\u003dXuX-MGTZnJoC\u0026amp;pg\u003dPA125\u0026amp;dq\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsK9iUczaDoSfiQf834DgBw\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;f\u003dfalse page 125\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The seeds of the \u0027\u0027pomegranate\u0027\u0027, for example, were widely used to prevent conception in the ancient world and they are still used in India, East Africa, and the Pacific\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Payam Nabarz, \u0027The Mysteries of Mithras: The Pagan Belief That Shaped the Christian World\u0027, [http://books.google.com.au/books?id\u003dOltMzIU1ae0C\u0026amp;pg\u003dPA79\u0026amp;dq\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsK9iUczaDoSfiQf834DgBw\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;f\u003dfalse page 79\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Persephone is taken to the underworld by Hades to be his queen. She willingly eats a seed of \u0027\u0027pomegranate\u0027\u0027 and is forced to spend every winter with her husband in the land of the dead, symbolizing the yearly decay and revival of vegetation\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"In Judaism, the number of seeds in a \u0027\u0027pomegranate\u0027\u0027 is said to be the exact number of mitzvah, or spiritual duties required of a devout Jew\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Wayne Gisslen, \u0027Professional Cooking, College Version\u0027, [http://books.google.com.au/books?id\u003dhxcH5o9QeywC\u0026amp;pg\u003dPA683\u0026amp;dq\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d0ttiUZm3LI69iAeeh4CIBw\u0026amp;redir_esc\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;f\u003dfalse page 683\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027pomegranate\u0027\u0027 is a subtropical fruit about the size of a large apple\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, David Joachim, \u0027Fire It Up: 40 Recipes for Grilling Everything\u0027, [http://books.google.com.au/books?id\u003doGuVASQBpN8C\u0026amp;pg\u003dPA310\u0026amp;dq\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dIeBiUajXIsbtiAeg6oHgAg\u0026amp;redir_esc\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pomegranate%22%7C%22pomegranates%22\u0026amp;f\u003dfalse page 310\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The grilled leeks are then drizzled with a gorgeous, ruby-red \u0027\u0027pomegranate\u0027\u0027 vinaigrette\", \"priority\":24}]}, \"synonyms\":{}}");

	add("pomerania", "{\"term\":\"pomerania\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A region of Europe on the southern shore of the Baltic Sea, originally a duchy, then a province of Prussia, and now an area shared by Germany and Poland\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1759\u0027\u0027, George Sale et al., \u0027The Modern Part of an Universal History\u0027, : \u0027History of the German Empire\u0027, [http://books.google.com/books?id\u003ddFtjAAAAMAAJ\u0026amp;pg\u003dPA2 page\u0026amp;nbsp;2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Since the reign of \u0027Charlemagne\u0027, this country is divided into \u0027High High\u0027 and \u0027Low Germany\u0027... the provinces of \u0027Lower Germany\u0027 towards the north conſiſt of the Low Country\u0027 of the \u0027Rhine\u0027, \u0027Triers\u0027, \u0027Cologn\u0027, \u0027Mentz\u0027, Weſtphalia\u0027, Heſſe\u0027, Brunſwic\u0027, Miſnia\u0027, Luſatia\u0027, \u0027High Saxony\u0027 upon the \u0027Elbe\u0027, \u0027Low Saxony\u0027 upon the \u0027Elbe\u0027, \u0027Mecklenburg\u0027, \u0027Lauenburg\u0027, \u0027Brandenburg\u0027, \u0027Magdeburg\u0027, and \u0027\u0027\u0027Pomerania\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pommy", "{\"term\":\"pommy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|pom|y|gloss2\u003ddiminutive suffix|lang\u003den}}. Australian from 1912.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pom; a person of British descent, a Briton; an Englishman\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1931\u0027\u0027, w:Miles Miles Franklin, \u0027Back to Bool Bool\u0027, [http://books.google.com.au/books?id\u003dYvfPAAAAMAAJ\u0026amp;q\u003d%22pommy%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22pommy%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003doDXjT6XhJOatiQfWlrT3Dg\u0026amp;redir_esc\u003dy page 140\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Though Sir Oswald had taken on enough London veneer to be sneered at as a \u0027\u0027pommy\u0027\u0027 in certain Australian circles, he had never acquired the high-class Englishman′s apparent equanimity or indifference before the prospect of cuckolding\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Tony Parsons, \u0027Silver in the Sun\u0027, [http://books.google.com.au/books?id\u003d6s73jQWCFnkC\u0026amp;pg\u003dPT115\u0026amp;dq\u003d%22pommy%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddi7jT-KFCuqTiAeWsqCDDw\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pommy%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Rhona nodded her agreement. ‘That′s a very interesting answer from a new Aussie – and a \u0027\u0027Pommy\u0027\u0027 into the bargain,’ she added\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Robert Holman, \u0027On Paths of Ash: The Extraordinary Story of an Australian Prisoner of War\u0027, [http://books.google.com.au/books?id\u003dVUynemaVDxMC\u0026amp;pg\u003dPT71\u0026amp;dq\u003d%22pommy%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddi7jT-KFCuqTiAeWsqCDDw\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pommy%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"During one of these acts of bravery by the English pilots I saw a great big tough Aussie with tears of frustration streaming down his face. He was shouting, ‘You magnificent, stupid \u0027\u0027Pommy\u0027\u0027 bastard!’\", \"priority\":9}]}, \"synonyms\":{}}");

